userDefinedLinkHintCss:
div > .vimiumHintMarker {
/* linkhint boxes */
background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#292d3e),
  color-stop(100%,#82aaff));
border: 1px solid #9cc4ff;
}

div > .vimiumHintMarker span {
/* linkhint text */
color: #bbc5ff;
font-weight: bold;
font-size: 16px;
}

div > .vimiumHintMarker > .matchingCharacter {
color: #292d3e;
font-weight: bold;
font-size: 16px;
}

input#vomnibarInput.vimiumReset {
color: #bbc5ff !important;
background-color: #292d3e !important;
} 

#vomnibar {
border-color: #434758;
background-color: #292d3e;
}

#vomnibar .vomnibarSearchArea {
background-color: #292d3e;
border-bottom: #82aaff;
} 

#vomnibar input {
border-color: #434758; 
}

#vomnibar ul{
background-color: #292d3e;
} 

#vomnibar li {
border-bottom: #434758; 
} 

#vomnibar li .vomnibarUrl {
color: #bbc5ff; 
} 

#vomnibar li .vomnibarMatch {
color: #bbc5ff;
}

#vomnibar li.vomnibarSelected {
background-color: #434758; 
}

#vomnibar li em .vomnibarMatch, #vomnibar li .vomnibarTitle .vomnibarMatch {
color: #292d3e;
} 

#vomnibar li em, #vomnibar li .vomnibarTitle {
color: #bbc5ff; 
}
